import React from 'react';
import './App.css';
import Landing from './packages/landing/Landing';
import ReactGA from 'react-ga';

function initializeReactGA() {
	console.log(process.env.REACT_APP_GA)
    ReactGA.initialize('UA-151213573-1');
    ReactGA.pageview('/');
}

function App() {

  initializeReactGA();

  return (
    <div className="App">
      <Landing />
    </div>
  );
}

export default App;
